function App() {
  return (
    <div class="currencyExchange">

          <h2>Currency Exchange</h2>
          <div class="container1">
          <p>
          <input type="number" id="currency1" value="1000"></input> 
          <select>
            <option value="usd">USD</option>
            <option value="myr">MYR</option>
          </select>
          <button type="button" id="exchangeButton">&#x21CB;</button><input type="number" id="currency2"></input>
          <select>
            <option value="usd">MYR</option>
            <option value="myr">USD</option>
          </select>
        </p>
        </div>
    </div>
  );
}

export default App;
